So proud of my friend Vee for organising this annual academic empowerment conference – and for her work to help every student reach their highest potential. 

I fight for education around the world. Equal access to education is an issue in many countries — and that includes the U.K., where students from underrepresented backgrounds face significant barriers to higher education. 

@VeeKativhu has been campaigning for equal access for the past four years through @empoweredbyvee_. She has inspired so many girls from disadvantaged backgrounds to apply for careers where they couldn’t see themselves before her encouragement. 

@empoweredbyvee_ offers free guidance, resources and support for students throughout the academic year. Young people in the U.K. need opportunities, contacts, confidence and more – and I'm happy to be a part of helping them build a better world for all of us.
